window.bookSummaryJSON = "<p>In 19th-century England, Kate and her sister Emily return to the family estate after their father dies. There, under the guardianship of a distant uncle, they live in a small lodge with two great-aunts. One evening while out late and unable to find their way home, they encounter a nest of goblins. Clare Dunkle unites the human realm and the underworld of the goblin in a fascinating and exciting tale.</p>"; 
